INSERT INTO `wp_posts` VALUES (2,93172865,'2020-12-14 16:25:29','2020-12-14 16:25:29','<!-- wp:coblocks/hero {"layout":"center-center","paddingSize":"medium","paddingSyncUnits":true,"customBackgroundColor":"#004fad","height":150,"contentAlign":"center","maxWidth":1000,"coblocks":{"id":"1115193224800"}} -->\n<div class="wp-block-coblocks-hero alignfull coblocks-hero-1115193224800"><div class="wp-block-coblocks-hero__inner has-background hero-center-center-align has-padding has-medium-padding has-center-content" style="background-color:#004fad;min-height:150px"><div class="wp-block-coblocks-hero__content-wrapper"><div class="wp-block-coblocks-hero__content" style="max-width:1000px"><!-- wp:heading {"textAlign":"left","placeholder":"Add hero heading","textColor":"white","style":{"typography":{"lineHeight":"1.5","fontSize":"32px"}}} -->\n<h2 class="has-text-align-left has-white-color has-text-color" style="font-size:32px;line-height:1.5"><strong>Vaccines are here</strong>.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {"align":"right","id":242,"width":175,"height":175,"sizeSlug":"large","linkDestination":"none"} -->\n<div class="wp-block-image"><figure class="alignright size-large is-resized"><img src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/vaccine-clip-art.png?w=500" alt="" class="wp-image-242" width="175" height="175"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {"align":"left","placeholder":"Add hero content, which is typically an introductory area of a page accompanied by call to action or two.","textColor":"white","style":{"typography":{"lineHeight":"1.5","fontSize":"16px"}}} -->\n<p class="has-text-align-left has-white-color has-text-color" style="font-size:16px;line-height:1.5">The FDA has granted emergency use authorization to the Pfizer-BioNTech COVID-19 Vaccine. Doses arrived in County on December 14, and will be distributed to healthcare workers and those with high vulnerabilities first.<br><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons {"contentJustification":"left","align":"center"} -->\n<div class="wp-block-buttons is-content-justification-left"><!-- wp:button {"placeholder":"Primary button","borderRadius":5,"style":{"color":{"background":"#ec5d4f"}},"textColor":"white","width":50} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50"><a class="wp-block-button__link has-white-color has-text-color has-background" href="https://vaccinestemplate.wpcomstaging.com/timeline/" style="border-radius:5px;background-color:#ec5d4f">When can I get the vaccine?</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div></div></div></div>\n<!-- /wp:coblocks/hero -->\n\n<!-- wp:spacer {"height":20} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"align":"center","style":{"typography":{"fontSize":"18px"}}} -->\n<p class="has-text-align-center" style="font-size:18px"><strong><span style="color:#004fad;" class="has-inline-color">We know you have questions.</span> <span style="color:#004fad;" class="has-inline-color">We\'re here to help.</span></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {"color":"black","className":"is-style-default"} -->\n<hr class="wp-block-separator has-text-color has-background has-black-background-color has-black-color is-style-default"/>\n<!-- /wp:separator -->\n\n<!-- wp:buttons -->\n<div class="wp-block-buttons"><!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/faqs#vaccine-work"><img class="wp-image-371" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/science.png" alt=""><br><br>How does the vaccine work?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/schedule-your-vaccination/"><img class="wp-image-369" style="width: 58px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/map-01.png" alt=""><br><br>Where can I get the vaccine?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/timeline/"><img class="wp-image-277" style="width: 64px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/calendar-1.png" alt=""><br><br>When can I get the vaccine?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/doses-given/"><img class="wp-image-286" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/vaccine-1.png" alt=""><br><br>How many people have received the vaccine?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/faqs#vaccine-safety"><img class="wp-image-284" style="width:60px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/magnifying-glass-1.png" alt=""><br><br>Is the vaccine safe?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/faqs#vaccine-effectiveness"><img class="wp-image-285" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/lungs-1.png" alt=""><br><br>Is the vaccine effective?</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->','','','publish','closed','closed','','home','','','2021-01-05 16:07:55','2021-01-06 00:07:55','',0,'https://vaccinestemplate.wpcomstaging.com/?page_id=2',0,'page','',0);
