INSERT INTO `wp_posts` VALUES (12,93172865,'2020-12-14 08:48:24','2020-12-14 16:48:24','<!-- wp:paragraph {"align":"left"} -->\n<p class="has-text-align-left">Visitors will want to know who is on the other side of the page. Use this space to write about yourself, your site, your business, or anything you want. Use the testimonials below to quote others, talking about the same thing  in their own words.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"align":"left"} -->\n<p class="has-text-align-left">This is sample content, included with the template to illustrate its features. Remove or replace it with your own words and media.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":32,"className":"desktop-only"} -->\n<div style="height:32px;" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {"align":"center","level":3} -->\n<h3 class="has-text-align-center">What People Say</h3>\n<!-- /wp:heading -->\n\n<!-- wp:columns {"align":"wide","className":"has-3-columns"} -->\n<div class="wp-block-columns alignwide has-3-columns"><!-- wp:column -->\n<div class="wp-block-column"><!-- wp:quote -->\n<blockquote class="wp-block-quote"><p>The way to get started is to quit talking and begin doing.</p><cite>Walt Disney</cite></blockquote>\n<!-- /wp:quote --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:quote -->\n<blockquote class="wp-block-quote"><p>It is our choices, Harry, that show what we truly are, far more than our abilities.</p><cite>J. K. Rowling</cite></blockquote>\n<!-- /wp:quote --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:quote -->\n<blockquote class="wp-block-quote"><p>Don\'t cry because it\'s over, smile because it happened.</p><cite>Dr. Seuss</cite></blockquote>\n<!-- /wp:quote --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {"height":32,"className":"desktop-only"} -->\n<div style="height:32px;" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:separator {"className":"is-style-wide"} -->\n<hr class="wp-block-separator is-style-wide" />\n<!-- /wp:separator -->\n\n<!-- wp:spacer {"height":32,"className":"desktop-only"} -->\n<div style="height:32px;" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {"align":"center"} -->\n<h2 class="has-text-align-center">Lets build something together.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:button {"align":"center"} -->\n<div class="wp-block-button aligncenter"><a class="wp-block-button__link" href="#">Get in touch!</a></div>\n<!-- /wp:button -->\n\n<!-- wp:spacer {"height":32,"className":"desktop-only"} -->\n<div style="height:32px;" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:separator {"className":"is-style-wide"} -->\n<hr class="wp-block-separator is-style-wide" />\n<!-- /wp:separator -->\n\n<!-- wp:spacer {"height":32} -->\n<div style="height:32px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->','About','','trash','closed','closed','','about__trashed','','','2020-12-19 22:54:21','2020-12-20 06:54:21','',0,'https://vaccinestemplate.wpcomstaging.com/about/',1,'page','',0);
INSERT INTO `wp_posts` VALUES (13,93172865,'2020-12-14 08:48:25','2020-12-14 16:48:25','<!-- wp:paragraph {"align":"left","style":{"typography":{"fontSize":"16px"}}} -->\n<p class="has-text-align-left" style="font-size:16px">The County Department of Public Health works to improve the health an well-being of all residents. We created this site to make it easy for our residents to learn more about COVID-19 vaccinations.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":32,"className":"desktop-only"} -->\n<div style="height:32px" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {"align":"wide","className":"has-2-columns"} -->\n<div class="wp-block-columns alignwide has-2-columns"><!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"textAlign":"left","level":4} -->\n<h4 class="has-text-align-left">Info</h4>\n<!-- /wp:heading -->\n\n<!-- wp:jetpack/contact-info -->\n<div class="wp-block-jetpack-contact-info"><!-- wp:jetpack/address {"address":"10 Street Road","city":"City","postal":"10100","country":"USA"} -->\n<div class="wp-block-jetpack-address"><div class="jetpack-address__address jetpack-address__address1">10 Street Road</div><div><span class="jetpack-address__city">City</span>, <span class="jetpack-address__region"></span> <span class="jetpack-address__postal">10100</span></div><div class="jetpack-address__country">USA</div></div>\n<!-- /wp:jetpack/address -->\n\n<!-- wp:jetpack/email {"email":"mail@example.com"} -->\n<div class="wp-block-jetpack-email"><a href="mailto:mail@example.com">mail@example.com</a></div>\n<!-- /wp:jetpack/email -->\n\n<!-- wp:jetpack/phone {"phone":"(555) 555 1234"} -->\n<div class="wp-block-jetpack-phone"><a href="tel:5555551234">(555) 555 1234</a></div>\n<!-- /wp:jetpack/phone --></div>\n<!-- /wp:jetpack/contact-info --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"textAlign":"left","level":4} -->\n<h4 class="has-text-align-left">Send Us a Message</h4>\n<!-- /wp:heading -->\n\n<!-- wp:jetpack/contact-form {"subject":"[County Covid-19 Vaccines] Contact Us","to":"rchandra100@gmail.com"} -->\n<!-- wp:jetpack/field-name {"required":true} /-->\n\n<!-- wp:jetpack/field-email {"label":"Email","required":true} /-->\n\n<!-- wp:jetpack/field-textarea {"required":true} /-->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n<!-- /wp:jetpack/contact-form --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->','Contact Us','','publish','closed','closed','','about-us','','','2021-01-06 00:37:45','2021-01-06 08:37:45','',0,'https://vaccinestemplate.wpcomstaging.com/contact/',1,'page','',0);
INSERT INTO `wp_posts` VALUES (14,93172865,'2020-12-14 08:48:26','1999-01-01 00:00:00','<!-- wp:cover {"url":"https:\\/\\/mordendemo.files.wordpress.com\\/2019\\/08\\/background-calm-clouds-747964-2.jpg","id":259,"dimRatio":40,"overlayColor":"foreground-dark","focalPoint":{"x":0.5,"y":0.43},"align":"full"} -->\n<div class="wp-block-cover alignfull has-background-dim-40 has-foreground-dark-background-color has-background-dim" style="background-image:url(\'https://mordendemo.files.wordpress.com/2019/08/background-calm-clouds-747964-2.jpg\');background-position:50% 43%;"><div class="wp-block-cover__inner-container"><!-- wp:heading {"level":1} -->\n<h1>Morden Mountain Movers</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>This is a cover block, with a heading, a paragraph, and a button block.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button -->\n<div class="wp-block-button"><a class="wp-block-button__link" href="https://mordendemo.wordpress.com/about/">About Us</a></div>\n<!-- /wp:button --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:spacer {"height":64,"className":"desktop-only"} -->\n<div style="height:64px;" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {"align":"wide"} -->\n<div class="wp-block-columns alignwide"><!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"level":5} -->\n<h5>Excellence</h5>\n<!-- /wp:heading -->\n\n<!-- wp:image {"id":261,"sizeSlug":"large"} -->\n<figure class="wp-block-image size-large"><img src="https://mordendemo.files.wordpress.com/2019/08/drangarnir-faroe-islands-fog-2582027-1.jpg?w=750" alt="" class="wp-image-261" /></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This is a group of blocks in columns. Column layouts can be adapted to fit different needs.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"level":5} -->\n<h5>Professionalism</h5>\n<!-- /wp:heading -->\n\n<!-- wp:image {"id":262,"sizeSlug":"large"} -->\n<figure class="wp-block-image size-large"><img src="https://mordendemo.files.wordpress.com/2019/08/adventure-bay-beach-861034-1.jpg?w=750" alt="" class="wp-image-262" /></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This is a group of blocks in columns. Column layouts can be adapted to fit different needs.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"level":5} -->\n<h5>Expertise</h5>\n<!-- /wp:heading -->\n\n<!-- wp:image {"id":263,"sizeSlug":"large"} -->\n<figure class="wp-block-image size-large"><img src="https://mordendemo.files.wordpress.com/2019/08/bay-beach-cliff-460890-1.jpg?w=750" alt="" class="wp-image-263" /></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This is a group of blocks in columns. Column layouts can be adapted to fit different needs.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {"height":32,"className":"desktop-only"} -->\n<div style="height:32px;" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:separator -->\n<hr class="wp-block-separator" />\n<!-- /wp:separator -->\n\n<!-- wp:spacer {"height":32,"className":"desktop-only"} -->\n<div style="height:32px;" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {"align":"wide"} -->\n<div class="wp-block-columns alignwide"><!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"level":5} -->\n<h5>Strategy</h5>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>This is a list block.</li><li>Lists can be bulleted or numbered. </li><li>Indent and outdent list items to create outlines.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"level":5} -->\n<h5>Growth</h5>\n<!-- /wp:heading -->\n\n<!-- wp:quote -->\n<blockquote class="