INSERT INTO `wp_posts` VALUES (35,93172865,'2020-12-14 18:07:04','2020-12-15 02:07:04','<!-- wp:paragraph {"style":{"typography":{"fontSize":"16px"}}} -->\n<p style="font-size:16px">The vaccine is now available, but will be given in priority order based on a number of factors. If you are a healthy American, you may wait longer than your fellow frontline workers or those who have underlying health conditions. Here is a tentative timeline of distributions in County:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[Placeholder]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {"sizeSlug":"large"} -->\n<figure class="wp-block-image size-large"><img src="https://covidvaccine.mo.gov/img/vaccine-availability.jpg" alt=""/></figure>\n<!-- /wp:image -->','Timeline','','publish','closed','closed','','timeline','','','2021-01-05 15:57:24','2021-01-05 23:57:24','',0,'https://vaccinestemplate.wpcomstaging.com/?page_id=35',0,'page','',0);
INSERT INTO `wp_posts` VALUES (36,93172865,'2020-12-14 18:07:06','2020-12-15 02:07:06','<!-- wp:paragraph -->\n<p>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDA\'s safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. Learn more by watching the video below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:embed {"url":"https:\\/\\/www.youtube.com\\/watch?time_continue=14\\u0026amp;v=HqsmhCJurTM\\u0026amp;feature=emb_logo","type":"rich","providerNameSlug":"youtube","responsive":true,"className":"wp-embed-aspect-16-9 wp-has-aspect-ratio"} -->\n<figure class="wp-block-embed is-type-rich is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio"><div class="wp-block-embed__wrapper">\nhttps://www.youtube.com/watch?time_continue=14&amp;v=HqsmhCJurTM&amp;feature=emb_logo\n</div></figure>\n<!-- /wp:embed -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Safety','','trash','closed','closed','','safety__trashed','','','2021-01-05 23:35:14','2021-01-06 07:35:14','',0,'https://vaccinestemplate.wpcomstaging.com/?page_id=36',0,'page','',0);
INSERT INTO `wp_posts` VALUES (37,93172865,'2020-12-14 18:07:08','2020-12-15 02:07:08','<!-- wp:paragraph -->\n<p>[Example Content Below]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Last updated January 5, 2021.<br>Available languages [Placeholders]: <a href="https://vaccinestemplate.wpcomstaging.com/faqs/">Espaol</a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/">Ting Vit</a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/"></a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/">Soomaali</a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p style="font-size:18px"><strong>Am I and my family eligible for the vaccine? </strong><br>The CDC recommends that initial supplies of COVID-19 vaccine be allocated to healthcare personnel and long-term care facility residents. This is referred to as Phase 1a. In the in the next phases (Phase 1b and Phase 1c), vaccination should be offered to people in the following groups.<br><br><em>Phase 1b</em><br>- Frontline essential workers such as fire fighters, police officers, corrections officers, food and agricultural workers, United States Postal Service workers, manufacturing workers, grocery store workers, public transit workers, and those who work in the educational sector (teachers, support staff, and daycare workers.)<br>- People aged 75 years and older because they are at high risk of hospitalization, illness, and death from COVID-19. People aged 75 years and older who are also residents of long-term care facilities should be offered vaccination in Phase 1a.<br><br><em>Phase 1c</em><br>- People aged 6574 years because they are at high risk of hospitalization, illness, and death from COVID-19. People aged 6574 years who are also residents of long-term care facilities should be offered vaccination in Phase 1a.<br> - People aged 1664 years with underlying medical conditions which increase the risk of serious, life-threatening complications from COVID-19.<br>- Other essential workers, such as people who work in transportation and logistics, food service, housing construction and finance, information technology, communications, energy, law, media, public safety, and public health.<br><br>As vaccine availability increases, vaccination recommendations will expand to include more groups. The goal is for everyone to be able to easily get a COVID-19 vaccination as soon as large enough quantities of vaccine are available. As vaccine supply increases but remains limited, ACIP will expand the groups recommended for vaccination. CDC made this recommendation on December 22, 2020.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-work" style="font-size:18px"><strong>How does the vaccine work?</strong><br>COVID-19 vaccines help our bodies develop immunity to the virus that causes COVID-19 without us having to get the illness. Different types of vaccines work in different ways to offer protection, but with all types of vaccines, the body is left with a supply of memory T-lymphocytes as well as B-lymphocytes that will remember how to fight that virus in the future. The vaccine requires two shots: the first shot starts building protection, and a second shot is needed a few weeks later to get the most protection the vaccine has to offer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-side-effects" style="font-size:18px"><strong>Are there side effects to the vaccine?</strong><br>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. For additional information, visit <a href="https://www.cdc.gov/coronavirus/2019-ncov/vaccines/safety.html">CDC</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-safety" style="font-size:18px"><strong>Is the vaccine safe?</strong><br>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. For additional information, visit <a href="https://www.cdc.gov/coronavirus/2019-ncov/vaccines/safety.html">CDC</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-effectiveness" style="font-size:18px"><strong>Is the vaccine effective?</strong><br>Pfizer/BioNTechs two-dose vaccine is about 95 percent effective against COVID-19, regardless of age, race or other risks for severe illness from an infection, an FDA analysis shows. Modernas phase 3 clinical trial found its vaccine to be 94.1 percent effective against COVID-19 and 100 percent effective against severe COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p style="font-size:18px"><strong><strong>How can I start to make a vaccine plan for myself and my family?</strong></strong><br>Being informed is the first step to making a plan. Get your information from reliable public health sources such as the Center for Disease Control and Prevention (CDC) and your local public health agency. When its your turn to get the vaccine, ask your primary care provider whether they plan to give the vaccine in their office or what they recommend for you based on your personal medical history. You can find vaccines near you with this interactive map here.</p>\n<!-- /wp:paragraph -->','FAQs','','publish','closed','closed','','faqs','','','2021-01-05 16:11:30','2021-01-06 00:11:30','',0,'https://vaccinestemplate.wpcomstaging.com/?page_id=37',0,'page','',0);
