INSERT INTO `wp_posts` VALUES (39,93172865,'2020-12-14 18:07:11','2020-12-15 02:07:11','<!-- wp:spacer {"height":20} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"24px"}}} -->\n<p style="font-size:24px"><strong><span style="color:#0071a1;" class="has-inline-color">Percent of County Vaccinated</span></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"16px"}}} -->\n<p style="font-size:16px">County has begun distributing vaccines. You can see how<br>many doses have been served below. [EXAMPLE BELOW]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n\n    <script type="text/javascript" src="https://www.gstatic.com/charts/loader.js"></script>\n    <script type="text/javascript">\n      google.charts.load(\'current\', {\'packages\':[\'corechart\']});\n      google.charts.setOnLoadCallback(drawChart);\n\n      function drawChart() {\n        var data = google.visualization.arrayToDataTable([\n          [\'Date\', \'% of County\'],\n          [\'Dec 1\',  1],\n          [\'Dec 8\',  2.3],\n          [\'Dec 15\',  4.8],\n          [\'Dec 22\',  7.8],\n          [\'Dec 29\',  10.2],\n          [\'Jan 4\',  15.5],\n        ]);\n\n        var options = {\n          curveType: \'function\',\n          legend: { position: \'bottom\' }\n        };\n\n        var chart = new google.visualization.LineChart(document.getElementById(\'curve_chart\'));\n\n        chart.draw(data, options);\n      }\n    </script>\n  \n  \n    <div id="curve_chart" style="width: 900px; height: 500px"></div>\n  \n<!-- /wp:html -->','Our Impact','','publish','closed','closed','','doses-given','','','2021-01-05 15:45:24','2021-01-05 23:45:24','',0,'https://vaccinestemplate.wpcomstaging.com/?page_id=39',0,'page','',0);
