INSERT INTO `wp_posts` VALUES (87,93172865,'2020-12-14 19:14:15','2020-12-15 03:14:15','<!-- wp:paragraph -->\n<p>Pfizer/BioNTech\'s two-dose vaccine is about 95 percent effective against COVID-19, regardless of age, race or other risks for severe illness from an infection, an FDA analysis shows. Modernas phase 3 clinical trial found its vaccine to be 94.1 percent effective against COVID-19 and 100 percent effective against severe COVID-19. To learn more about how COVID vaccines would work in your body, watch the video below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:embed {"url":"https:\\/\\/www.youtube.com\\/watch?v=k7E88xEGOaE\\u0026amp;feature=emb_logo","type":"rich","providerNameSlug":"youtube","responsive":true,"className":"wp-embed-aspect-16-9 wp-has-aspect-ratio"} -->\n<figure class="wp-block-embed is-type-rich is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio"><div class="wp-block-embed__wrapper">\nhttps://www.youtube.com/watch?v=k7E88xEGOaE&amp;feature=emb_logo\n</div></figure>\n<!-- /wp:embed -->','Effectiveness','','inherit','closed','closed','','37-revision-v1','','','2020-12-14 19:14:15','2020-12-15 03:14:15','',37,'https://vaccinestemplate.wpcomstaging.com/2020/12/14/37-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (88,93172865,'2020-12-14 19:15:27','2020-12-15 03:15:27','<!-- wp:paragraph -->\n<p>Pfizer/BioNTech\'s two-dose vaccine is about 95 percent effective against COVID-19, regardless of age, race or other risks for severe illness from an infection, an FDA analysis shows. Modernas phase 3 clinical trial found its vaccine to be 94.1 percent effective against COVID-19 and 100 percent effective against severe COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>However, stopping the pandemic will continue to require everyone  even if vaccinated - to continue to follow all current guidance to protect themselves &amp; others, including wearing a mask, staying at least 6 feet away from others, limiting activities outside the home and avoiding crowds, washing hands often, following CDC travel guidance, and following quarantine guidance after an exposure to someone with COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To learn more about how COVID vaccines would work in your body, watch the video below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:embed {"url":"https:\\/\\/www.youtube.com\\/watch?v=k7E88xEGOaE\\u0026amp;feature=emb_logo","type":"rich","providerNameSlug":"youtube","responsive":true,"className":"wp-embed-aspect-16-9 wp-has-aspect-ratio"} -->\n<figure class="wp-block-embed is-type-rich is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio"><div class="wp-block-embed__wrapper">\nhttps://www.youtube.com/watch?v=k7E88xEGOaE&amp;feature=emb_logo\n</div></figure>\n<!-- /wp:embed -->','Effectiveness','','inherit','closed','closed','','37-revision-v1','','','2020-12-14 19:15:27','2020-12-15 03:15:27','',37,'https://vaccinestemplate.wpcomstaging.com/2020/12/14/37-revision-v1/',0,'revision','',0);
