INSERT INTO `wp_posts` VALUES (269,93172865,'2020-12-19 21:20:38','2020-12-20 05:20:38','<!-- wp:coblocks/hero {"layout":"center-center","paddingSize":"medium","paddingSyncUnits":true,"customBackgroundColor":"#004fad","height":200,"contentAlign":"center","maxWidth":1000,"coblocks":{"id":"1115193224800"}} -->\n<div class="wp-block-coblocks-hero alignfull coblocks-hero-1115193224800"><div class="wp-block-coblocks-hero__inner has-background hero-center-center-align has-padding has-medium-padding has-center-content" style="background-color:#004fad;min-height:200px;"><div class="wp-block-coblocks-hero__content-wrapper"><div class="wp-block-coblocks-hero__content" style="max-width:1000px;"><!-- wp:heading {"textAlign":"left","placeholder":"Add hero heading\\u2026","textColor":"white","style":{"typography":{"lineHeight":"1.5","fontSize":"32px"}}} -->\n<h2 class="has-text-align-left has-white-color has-text-color" style="font-size:32px;line-height:1.5;"><strong>Vaccines are here!</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {"align":"right","id":242,"width":175,"height":175,"sizeSlug":"large","linkDestination":"none"} -->\n<div class="wp-block-image"><figure class="alignright size-large is-resized"><img src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/vaccine-clip-art.png?w=500" alt="" class="wp-image-242" width="175" height="175" /></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {"align":"left","placeholder":"Add hero content, which is typically an introductory area of a page accompanied by call to action or two.","textColor":"white","style":{"typography":{"lineHeight":"1.5","fontSize":"16px"}}} -->\n<p class="has-text-align-left has-white-color has-text-color" style="font-size:16px;line-height:1.5;">The FDA has granted emergency use authorization to the Pfizer-BioNTech COVID-19 Vaccine. Doses arrived in [County] on December 14, and will be distributed to healthcare workers and those with high vulnerabilities first.<br><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons {"contentJustification":"left","align":"center"} -->\n<div class="wp-block-buttons is-content-justification-left"><!-- wp:button {"placeholder":"Primary button\\u2026","borderRadius":5,"style":{"color":{"background":"#ec5d4f"}},"textColor":"white","width":50} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50"><a class="wp-block-button__link has-white-color has-text-color has-background" style="border-radius:5px;background-color:#ec5d4f;">When can I get the vaccine?</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div></div></div></div>\n<!-- /wp:coblocks/hero -->\n\n<!-- wp:spacer {"height":20} -->\n<div style="height:20px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:buttons -->\n<div class="wp-block-buttons"><!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/timeline/"><img class="wp-image-251" style="width:30px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/calendar.png" alt=""> When can I get the vaccine?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/safety/"><img class="wp-image-257" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/magnifying-glass.png" alt=""><br><br>Is the vaccine safe?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outli