Color":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/safety/"><img class="wp-image-284" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/magnifying-glass-1.png" alt=""><br><br>Is the vaccine safe?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/effectiveness/"><img class="wp-image-285" style="width:73px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/lungs-1.png" alt=""><br><br>Is the vaccine effective?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/doses-given/"><img class="wp-image-286" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/vaccine-1.png" alt=""><br><br>How many people have received the vaccine?</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->','','','inherit','closed','closed','','2-revision-v1','','','2020-12-19 21:32:41','2020-12-20 05:32:41','',2,'https://vaccinestemplate.wpcomstaging.com/2020/12/19/2-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (289,93172865,'2020-12-19 21:37:34','2020-12-20 05:37:34','<!-- wp:paragraph -->\n<p><strong>Is the vaccine effective?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pfizer/BioNTech\'s two-dose vaccine is about 95 percent effective against COVID-19, regardless of age, race or other risks for severe illness from an infection, an FDA analysis shows. Modernas phase 3 clinical trial found its vaccine to be 94.1 percent effective against COVID-19 and 100 percent effective against severe COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":24} -->\n<div style="height:24px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p><strong>Can my life go back to normal after I\'m vaccinated?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Until almost all people have received vaccines, stopping the pandemic will continue to require everyone  even if vaccinated - to continue to follow all current guidance to protect themselves &amp; others. This includes wearing a mask, staying at least 6 feet away from others, limiting activities outside the home and avoiding crowds, washing hands often, following CDC travel guidance, and following quarantine guidance after an exposure to someone with COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To learn more about how COVID vaccines would work in your body, watch the video below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:embed {"url":"https:\\/\\/www.youtube.com\\/watch?v=k7E88xEGOaE\\u0026amp;feature=emb_logo","type":"rich","providerNameSlug":"youtube","responsive":true,"className":"wp-embed-aspect-16-9 wp-has-aspect-ratio"} -->\n<figure class="wp-block-embed is-type-rich is-provider-youtube wp-block-embed-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio"><div class="wp-block-embed__wrapper">\nhttps://www.youtube.com/watch?v=k7E88xEGOaE&amp;feature=emb_logo\n</div></figure>\n<!-- /wp:embed -->','FAQs','','inherit','closed','closed','','37-revision-v1','','','2020-12-19 21:37:34','2020-12-20 05:37:34','',37,'https://vaccinestemplate.wpcomstaging.com/2020/12/19/37-revision-v1/',0,'revision','',0);
