INSERT INTO `wp_posts` VALUES (293,93172865,'2020-12-19 21:40:31','2020-12-20 05:40:31','<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p style="font-size:18px;"><strong>Is the vaccine effective?</strong><br>Pfizer/BioNTech\'s two-dose vaccine is about 95 percent effective against COVID-19, regardless of age, race or other risks for severe illness from an infection, an FDA analysis shows. Modernas phase 3 clinical trial found its vaccine to be 94.1 percent effective against COVID-19 and 100 percent effective against severe COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p style="font-size:18px;"><strong>Is the vaccine safe?</strong><br>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. Learn more by watching the video below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p style="font-size:18px;"><strong>Will my life go back to normal after I\'m vaccinated?</strong><br>Until almost all people have received vaccines, stopping the pandemic will continue to require everyone  even if vaccinated - to continue to follow all current guidance to protect themselves &amp; others. This includes wearing a mask, staying at least 6 feet away from others, limiting activities outside the home and avoiding crowds, washing hands often, following CDC travel guidance, and following quarantine guidance after an exposure to someone with COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','FAQs','','inherit','closed','closed','','37-revision-v1','','','2020-12-19 21:40:31','2020-12-20 05:40:31','',37,'https://vaccinestemplate.wpcomstaging.com/2020/12/19/37-revision-v1/',0,'revision','',0);
