INSERT INTO `wp_posts` VALUES (338,93172865,'2020-12-19 22:56:29','2020-12-20 06:56:29','<!-- wp:paragraph {"align":"left","style":{"typography":{"fontSize":"16px"}}} -->\n<p class="has-text-align-left" style="font-size:16px;">The County Department of Public Health works to improve the health an well-being of all residents. We created this site to make it easy for our residents to learn more about COVID-19 vaccinations.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":32,"className":"desktop-only"} -->\n<div style="height:32px;" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {"align":"wide","className":"has-2-columns"} -->\n<div class="wp-block-columns alignwide has-2-columns"><!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"textAlign":"left","level":4} -->\n<h4 class="has-text-align-left">Contact Us</h4>\n<!-- /wp:heading -->\n\n<!-- wp:jetpack/contact-info -->\n<div class="wp-block-jetpack-contact-info"><!-- wp:jetpack/address {"address":"10 Street Road","city":"City","postal":"10100","country":"USA"} -->\n<div class="wp-block-jetpack-address"><div class="jetpack-address__address jetpack-address__address1">10 Street Road</div><div><span class="jetpack-address__city">City</span>, <span class="jetpack-address__region"></span> <span class="jetpack-address__postal">10100</span></div><div class="jetpack-address__country">USA</div></div>\n<!-- /wp:jetpack/address -->\n\n<!-- wp:jetpack/email {"email":"mail@example.com"} -->\n<div class="wp-block-jetpack-email"><a href="mailto:mail@example.com">mail@example.com</a></div>\n<!-- /wp:jetpack/email -->\n\n<!-- wp:jetpack/phone {"phone":"(555) 555 1234"} -->\n<div class="wp-block-jetpack-phone"><a href="tel:5555551234">(555) 555 1234</a></div>\n<!-- /wp:jetpack/phone --></div>\n<!-- /wp:jetpack/contact-info --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"textAlign":"left","level":4} -->\n<h4 class="has-text-align-left">Send Us a Message</h4>\n<!-- /wp:heading -->\n\n<!-- wp:jetpack/contact-form -->\n<!-- wp:jetpack/field-name {"required":true} /-->\n\n<!-- wp:jetpack/field-email {"label":"Email","required":true} /-->\n\n<!-- wp:jetpack/field-url /-->\n\n<!-- wp:jetpack/field-textarea {"required":true} /-->\n<!-- /wp:jetpack/contact-form --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->','About Us','','inherit','closed','closed','','13-revision-v1','','','2020-12-19 22:56:29','2020-12-20 06:56:29','',13,'https://vaccinestemplate.wpcomstaging.com/2020/12/19/13-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (339,93172865,'2020-12-19 23:00:18','2020-12-20 07:00:18','<!-- wp:coblocks/hero {"layout":"center-center","paddingSize":"medium","paddingSyncUnits":true,"customBackgroundColor":"#004fad","height":150,"contentAlign":"center","maxWidth":1000,"coblocks":{"id":"1115193224800"}} -->\n<div class="wp-block-coblocks-hero alignfull coblocks-hero-1115193224800"><div class="wp-block-coblocks-hero__inner has-background hero-center-center-align has-padding has-medium-padding has-center-content" style="background-color:#004fad;min-height:150px;"><div class="wp-block-coblocks-hero__content-wrapper"><div class="wp-block-coblocks-hero__content" style="max-width:1000px;"><!-- wp:heading {"textAlign":"left","placeholder":"Add hero heading\\u2026","textColor":"white","style":{"typography":{"lineHeight":"1.5","fontSize":"32px"}}} -->\n<h2 class="has-text-align-left has-white-color has-text-color" style="font-size:32px;line-height:1.5;"><strong>Vaccines are here</strong>.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {"align":"right","id":242,"width":175,"height":175,"sizeSlug":"large","linkDestination":"none"} -->\n<div class="wp-block-image"><figure class="alignright size-large is-resized"><img src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/vaccine-clip-art.png?w=500" alt="" class="wp-image-242" width="175" height="175" /></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {"align":"left","placeholder":"Add hero content, which is typically an introductory area of a page accompanied by call to action or two.","textColor":"white","style":{"typography":{"lineHeight":"1.5","fontSize":"16px"}}} -->\n<p class="has-text-align-left has-white-color has-text-color" style="font-size:16px;line-height:1.5;">The FDA has granted emergency use authorization to the Pfizer-BioNTech COVID-19 Vaccine. Doses arrived in County on December 14, and will be distributed to healthcare workers and those with high vulnerabilities first.<br><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons {"contentJustification":"left","align":"center"} -->\n<div class="wp-block-buttons is-content-justification-left"><!-- wp:button {"placeholder":"Primary button\\u2026","borderRadius":5,"style":{"color":{"background":"#ec5d4f"}},"textColor":"white","width":50} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50"><a class="wp-block-button__link has-white-color has-text-color has-background" href="https://vaccinestemplate.wpcomstaging.com/timeline/" style="border-radius:5px;background-color:#ec5d4f;">When can I get the vaccine?</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div></div></div></div>\n<!-- /wp:coblocks/hero -->\n\n<!-- wp:spacer {"height":20} -->\n<div style="height:20px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"align":"center","style":{"typography":{"fontSize":"18px"}}} -->\n<p class="has-text-align-center" style="font-size:18px;"><strong><span style="color:#004fad;" class="has-inline-color">We know you have questions.</span> <span style="color:#004fad;" class="has-inline-color">We\'re here to help.</span></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {"color":"black","className":"is-style-default"} -->\n<hr class="wp-block-separator has-text-color has-background has-black-background-color has-black-color is-style-default" />\n<!-- /wp:separator -->\n\n<!-- wp:buttons -->\n<div class="wp-block-buttons"><!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/timeline/"><img class="wp-image-277" style="width:50px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/calendar-1.png" alt=""><br><br>When can I get the vaccine?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/faqs#vaccine-safety"><img class="wp-image-284" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/magnifying-glass-1.png" alt=""><br><br>Is the vaccine safe?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/faqs#vaccine-effectiveness"><img class="wp-image-285" style="width:73px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/lungs-1.png" alt=""><br><br>Is the vaccine effective?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/doses-given/"><img class="wp-image-286" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/vaccine-1.png" alt=""><br><br>How many people have received the vaccine?</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->','','','inherit','closed','closed','','2-revision-v1','','','2020-12-19 23:00:18','2020-12-20 07:00:18','',2,'https://vaccinestemplate.wpcomstaging.com/2020/12/19/2-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (340,0,'2020-12-20 21:04:38','2020-12-21 05:04:38','\n<!--more-->\nAUTHOR: \nAUTHOR EMAIL: \nAUTHOR URL: \nSUBJECT: [County Covid-19 Vaccines] Timeline\nIP: 136.24.118.46\nArray\n(\n    [1_How old are you?] =&gt; 25\n    [2_Which ZIP code do you live in?] =&gt; 94105\n    [3_Are you a health care worker or first responder? YES or NO] =&gt; YES\n    [4_Are you an essential worker (e.g.&#044; food&#044; energy&#044; etc.) or teacher? YES or NO] =&gt; NO\n    [5_Do you have underlying COVID-related heath risks (e.g.&#044; heart disease&#044; cancer&#044; diabetes&#044; obesity&#044; etc.)? YES or NO] =&gt; NO\n    [email_marketing_consent] =&gt; \n    [entry_title] =&gt; Timeline\n    [entry_permalink] =&gt; https://vaccinestemplate.wpcomstaging.com/timeline/\n    [feedback_id] =&gt; c36334e55c92a36461073cd3b613b3b5\n)\n','- 2020-12-20 21:04:38','','publish','closed','closed','','c36334e55c92a36461073cd3b613b3b5','','','2020-12-20 21:04:38','2020-12-21 05:04:38','',35,'https://vaccinestemplate.wpcomstaging.com/?post_type=feedback&p=340',0,'feedback','',0);
