INSERT INTO `wp_posts` VALUES (380,93172865,'2020-12-28 21:08:09','2020-12-29 05:08:09','<!-- wp:paragraph {"style":{"typography":{"fontSize":"16px"}}} -->\n<p style="font-size:16px;">The vaccine is now available, but will be given in priority order based on a number of factors. If you are a healthy American, you may wait longer than your fellow frontline workers or those who have underlying health conditions. To find out more, first tell us about yourself:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"16px"}}} -->\n<p style="font-size:16px;"><span style="color:#a5a29d;" class="has-inline-color"><em>NOTE: No information is stored or shared.</em></span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:jetpack/contact-form -->\n<!-- wp:jetpack/field-text {"label":"How old are you?","required":true} /-->\n\n<!-- wp:jetpack/field-text {"label":"Which ZIP code do you live in?","required":true} /-->\n\n<!-- wp:jetpack/field-text {"label":"Are you a health care worker or first responder? \\u003cem\\u003e\\u003cstrong\\u003eYES or NO\\u003c\\/strong\\u003e\\u003c\\/em\\u003e","required":true} /-->\n\n<!-- wp:jetpack/field-text {"label":"Are you an essential worker (e.g., food, energy, etc.) or teacher? \\u003cem\\u003e\\u003cstrong\\u003eYES or NO\\u003c\\/strong\\u003e\\u003c\\/em\\u003e","required":true} /-->\n\n<!-- wp:jetpack/field-text {"label":"Do you have underlying COVID-related heath risks (e.g., heart disease, cancer, diabetes, obesity, etc.)? \\u003cem\\u003e\\u003cstrong\\u003eYES or NO\\u003c\\/strong\\u003e\\u003c\\/em\\u003e","required":true} /-->\n\n<!-- wp:jetpack/button {"element":"button","text":"SUBMIT"} /-->\n\n<!-- wp:paragraph -->\n<p>[Note, this questionnaire is currently placeholder. After we are done building our system, clicking Submit will display your place in line and estimated timeline.]</p>\n<!-- /wp:paragraph -->\n<!-- /wp:jetpack/contact-form -->','Timeline','','inherit','closed','closed','','35-revision-v1','',