INSERT INTO `wp_posts` VALUES (384,93172865,'2021-01-04 15:37:03','2021-01-04 23:37:03','<!-- wp:spacer {"height":20} -->\n<div style="height:20px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"24px"}}} -->\n<p style="font-size:24px;"><strong><span style="color:#0071a1;" class="has-inline-color">Percent of County Vaccinated</span></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"16px"}}} -->\n<p style="font-size:16px;">County has begun distributing vaccines. You can see how<br>many doses have been served below. [EXAMPLE BELOW]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {"align":"left","id":302,"width":522,"height":290,"sizeSlug":"large","linkDestination":"none"} -->\n<div class="wp-block-image"><figure class="alignleft size-large is-resized"><img src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/frame-34-1.png?w=635" alt="" class="wp-image-302" width="522" height="290" /></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:spacer {"height":40} -->\n<div style="height:40px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:html -->\n\n  \n    \n    Line chart from CSV using d3.js\n    <a href="https://d3js.org/d3.v4.min.js">https://d3js.org/d3.v4.min.js</a>\n    \n\n	    html, body {\n		    margin: 0;\n		    padding: 0;\n		    height: 100%;\n		    width: 100%;\n	    }\n\n	    text {\n		    font-family: arial;\n		    font-size: 12px;\n	    }\n\n\n	    path.line {\n		    fill: none;\n		    stroke: red;\n		    stroke-width: 3px;\n	    }\n\n		.axis path,\n		.axis line {\n		  fill: none;\n		  stroke: slategray;\n		  shape-rendering: crispEdges;\n		}\n    \n  \n  \n\n	\n\nvar parseDate = d3.timeParse("%m/%d/%Y");\n\nvar margin = {left: 50, right: 20, top: 20, bottom: 50 };\n\nvar width = 960 - margin.left - margin.right;\nvar height = 500 - margin.top - margin.bottom;\n\n\nvar max = 0;\n\nvar xNudge = 50;\nvar yNudge = 20;\n\nvar minDate = new Date();\nvar maxDate = new Date();\n\n\n\n\nd3.csv("prices.csv")\n    .row(function(d) { return { month: parseDate(d.month), price: Number(d.price.trim().slice(1))}; })\n    .get(function(error, rows) {\n	    max = d3.max(rows, function(d) { return d.price; });\n	    minDate = d3.min(rows, function(d) {return d.month; });\n		maxDate = d3.max(rows, function(d) { return d.month; });\n\n\n		var y = d3.scaleLinear()\n					.domain([0,max])\n					.range([height,0]);\n\n		var x = d3.scaleTime()\n					.domain([minDate,maxDate])\n					.range([0,width]);\n\n		var yAxis = d3.axisLeft(y);\n\n		var xAxis = d3.axisBottom(x);\n\n		var line = d3.line()\n			.x(function(d){ return x(d.month); })\n			.y(function(d){ return y(d.price); })\n			.curve(d3.curveCardinal);\n\n\n		var svg = d3.select("body").append("svg").attr("id","svg").attr("height","100%").attr("width","100%");\n		var chartGroup = svg.append("g").attr("class","chartGroup").attr("transform","translate("+xNudge+","+yNudge+")");\n\n		chartGroup.append("path")\n			.attr("class","line")\n			.attr("d",function(d){ return line(rows); })\n\n\n		chartGroup.append("g")\n			.attr("class","axis x")\n			.attr("transform","translate(0,"+height+")")\n			.call(xAxis);\n\n		chartGroup.append("g")\n			.attr("class","axis y")\n			.call(yAxis);\n\n\n\n	});\n\n\n\n\n\n	\n  \n\n<!-- /wp:html -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"24px"}}} -->\n<p style="font-size:24px;"><strong><span style="color:#0071a1;" class="has-inline-color">Vaccines in State</span></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"16px"}}} -->\n<p style="font-size:16px;">Percentage of each county population in State who have<br>received the vaccine since it became available. [EXAMPLE BELOW]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {"align":"left","id":303,"width":581,"height":423,"sizeSlug":"large","linkDestination":"none"} -->\n<div class="wp-block-image"><figure class="alignleft size-large is-resized"><img src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/group-6-1.png?w=684" alt="" class="wp-image-303" width="581" height="423" /></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Percent Served','','inherit','closed','closed','','39-revision-v1','','','2021-01-04 15:37:03','2021-01-04 23:37:03','',39,'https://vaccinestemplate.wpcomstaging.com/2021/01/04/39-revision-v1/',0,'revision','',0);
