INSERT INTO `wp_posts` VALUES (398,93172865,'2021-01-04 17:49:04','2021-01-05 01:49:04','<!-- wp:spacer {"height":20} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"24px"}}} -->\n<p style="font-size:24px"><strong><span style="color:#0071a1;" class="has-inline-color">Percent of County Vaccinated</span></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"16px"}}} -->\n<p style="font-size:16px">County has begun distributing vaccines. You can see how<br>many doses have been served below. [EXAMPLE BELOW]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<head>\n    <script type="text/javascript" src="https://www.gstatic.com/charts/loader.js"></script>\n    <script type="text/javascript">\n      google.charts.load(\'current\', {\'packages\':[\'corechart\']});\n      google.charts.setOnLoadCallback(drawChart);\n\n      function drawChart() {\n        var data = google.visualization.arrayToDataTable([\n          [\'Date\', \'% of County\'],\n          [\'Dec 1\',  1],\n          [\'Dec 8\',  2.3],\n          [\'Dec 15\',  4.8],\n          [\'Dec 22\',  7.8],\n          [\'Dec 29\',  10.2],\n          [\'Jan 4\',  15.5],\n        ]);\n\n        var options = {\n          curveType: \'function\',\n          legend: { position: \'bottom\' }\n        };\n\n        var chart = new google.visualization.LineChart(document.getElementById(\'curve_chart\'));\n\n        chart.draw(data, options);\n      }\n    </script>\n  </head>\n  <body>\n    <div id="curve_chart" style="width: 900px; height: 500px"></div>\n  </body>\n<!-- /wp:html -->','Percent Served','','inherit','closed','closed','','39-revision-v1','','','2021-01-04 17:49:04','2021-01-05 01:49:04','',39,'https://vaccinestemplate.wpcomstaging.com/2021/01/04/39-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (401,93172865,'2021-01-05 15:38:12','2021-01-05 23:38:12','<!-- wp:paragraph -->\n<p>[Example Content Below]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Last updated January 5, 2021. Available languages: Espaol | Ting Vit |  | Soomaali |  <strong>1. Am I and my family eligible for the vaccine? </strong>The CDC recommends that initial supplies of COVID-19 vaccine be allocated to healthcare personnel and long-term care facility residents. This is referred to as Phase 1a. In the in the next phases (Phase 1b and Phase 1c), vaccination should be offered to people in the following groups. Phase 1b - Frontline essential workers such as fire fighters, police officers, corrections officers, food and agricultural workers, United States Postal Service workers, manufacturing workers, grocery store workers, public transit workers, and those who work in the educational sector (teachers, support staff, and daycare workers.) - People aged 75 years and older because they are at high risk of hospitalization, illness, and death from COVID-19. People aged 75 years and older who are also residents of long-term care facilities should be offered vaccination in Phase 1a. Phase 1c - People aged 6574 years because they are at high risk of hospitalization, illness, and death from COVID-19. People aged 6574 years who are also residents of long-term care facilities should be offered vaccination in Phase 1a. - People aged 1664 years with underlying medical conditions which increase the risk of serious, life-threatening complications from COVID-19. - Other essential workers, such as people who work in transportation and logistics, food service, housing construction and finance, information technology, communications, energy, law, media, public safety, and public health. As vaccine availability increases, vaccination recommendations will expand to include more groups. The goal is for everyone to be able to easily get a COVID-19 vaccination as soon as large enough quantities of vaccine are available. As vaccine supply increases but remains limited, ACIP will expand the groups recommended for vaccination. CDC made this recommendation on December 22, 2020. <strong>3</strong> <strong>5. What are the side effects of the vaccine? </strong>Getting either the Pfizer-BioNTech vaccine or the Moderna vaccine can cause some temporary discomfort, just like many vaccines do. In addition to a sore arm, people can experience a fever and some flu-like symptoms  fatigue, aches, chills, headache. The side effects of the vaccine typically start within 12 to 24 hours of vaccination. If you experience side effects that last beyond 48 hours, you should contact your doctor or medical provider for advice. The process of building immunity can cause symptoms. These symptoms are normal and show that your bodys immune system is responding to a vaccine. Other routine vaccines, like the flu vaccine, have similar side effects. <strong>6. Is the vaccine safe? </strong>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. For additional information, visit<a href="https://www.cdc.gov/coronavirus/2019-ncov/vaccines/safety.html">CD</a>C. <strong>7. Is the vaccine Effective? </strong>Pfizer/BioNTechs two-dose vaccine is about 95 percent effective against COVID-19, regardless of age, race or other risks for severe illness from an infection, an FDA analysis shows. Modernas phase 3 clinical trial found its vaccine to be 94.1 percent effective against COVID-19 and 100 percent effective against severe COVID-19. <strong>8. How can I start to make a vaccine plan for myself and my family? </strong>Being informed is the first step to making a plan. Get your information from reliable public health sources such as the Center for Disease Control and Prevention (CDC) and your local public health agency. When its your turn to get the vaccine, ask your primary care provider whether they plan to give the vaccine in their office or what they recommend for you based on your personal medical history. You can find vaccines near you with this interactive map here.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-work" style="font-size:18px"><strong>How does the vaccine work?</strong><br>COVID-19 vaccines help our bodies develop immunity to the virus that causes COVID-19 without us having to get the illness. Different types of vaccines work in different ways to offer protection, but with all types of vaccines, the body is left with a supply of memory T-lymphocytes as well as B-lymphocytes that will remember how to fight that virus in the future. The vaccine requires two shots: the first shot starts building protection, and a second shot is needed a few weeks later to get the most protection the vaccine has to offer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-side-effects" style="font-size:18px"><strong>Are there side effects to the vaccine?</strong><br>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. For additional information, visit <a href="https://www.cdc.gov/coronavirus/2019-ncov/vaccines/safety.html">CDC</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-safety" style="font-size:18px"><strong>Is the vaccine safe?</strong><br>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. For additional information, visit <a href="https://www.cdc.gov/coronavirus/2019-ncov/vaccines/safety.html">CDC</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-effectiveness" style="font-size:18px"><strong>Is the vaccine effective?</strong><br>Pfizer/BioNTech\'s two-dose vaccine is about 95 percent effective against COVID-19, regardless of age, race or other risks for severe illness from an infection, an FDA analysis shows. Modernas phase 3 clinical trial found its vaccine to be 94.1 percent effective against COVID-19 and 100 percent effective against severe COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p style="font-size:18px"><strong>Will my life go back to normal after I\'m vaccinated?</strong><br>Until almost all people have received vaccines, stopping the pandemic will continue to require everyone  even if vaccinated - to continue to follow all current guidance to protect themselves &amp; others. This includes wearing a mask, staying at least 6 feet away from others, limiting activities outside the home and avoiding crowds, washing hands often, following CDC travel guidance, and following quarantine guidance after an exposure to someone with COVID-19.</p>\n<!-- /wp:paragraph -->','FAQs','','inherit','closed','closed','','37-revision-v1','','','2021-01-05 15:38:12','2021-01-05 23:38:12','',37,'https://vaccinestemplate.wpcomstaging.com/2021/01/05/37-revision-v1/',0,'revision','',0);
