INSERT INTO `wp_posts` VALUES (404,93172865,'2021-01-05 15:43:59','2021-01-05 23:43:59','<!-- wp:paragraph -->\n<p>[Example Content Below]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Last updated January 5, 2021.<br>Available languages: <a href="https://vaccinestemplate.wpcomstaging.com/faqs/">Espaol</a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/">Ting Vit</a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/"></a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/">Soomaali</a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-work" style="font-size:18px"><strong>Am I and my family eligible for the vaccine? </strong><br>The CDC recommends that initial supplies of COVID-19 vaccine be allocated to healthcare personnel and long-term care facility residents. This is referred to as Phase 1a. In the in the next phases (Phase 1b and Phase 1c), vaccination should be offered to people in the following groups.<br><br><em>Phase 1b</em><br>- Frontline essential workers such as fire fighters, police officers, corrections officers, food and agricultural workers, United States Postal Service workers, manufacturing workers, grocery store workers, public transit workers, and those who work in the educational sector (teachers, support staff, and daycare workers.)<br>- People aged 75 years and older because they are at high risk of hospitalization, illness, and death from COVID-19. People aged 75 years and older who are also residents of long-term care facilities should be offered vaccination in Phase 1a.<br><br><em>Phase 1c</em><br>- People aged 6574 years because they are at high risk of hospitalization, illness, and death from COVID-19. People aged 6574 years who are also residents of long-term care facilities should be offered vaccination in Phase 1a.<br> - People aged 1664 years with underlying medical conditions which increase the risk of serious, life-threatening complications from COVID-19.<br>- Other essential workers, such as people who work in transportation and logistics, food service, housing construction and finance, information technology, communications, energy, law, media, public safety, and public health.<br><br>As vaccine availability increases, vaccination recommendations will expand to include more groups. The goal is for everyone to be able to easily get a COVID-19 vaccination as soon as large enough quantities of vaccine are available. As vaccine supply increases but remains limited, ACIP will expand the groups recommended for vaccination. CDC made this recommendation on December 22, 2020.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-work" style="font-size:18px"><strong>How does the vaccine work?</strong><br>COVID-19 vaccines help our bodies develop immunity to the virus that causes COVID-19 without us having to get the illness. Different types of vaccines work in different ways to offer protection, but with all types of vaccines, the body is left with a supply of memory T-lymphocytes as well as B-lymphocytes that will remember how to fight that virus in the future. The vaccine requires two shots: the first shot starts building protection, and a second shot is needed a few weeks later to get the most protection the vaccine has to offer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-side-effects" style="font-size:18px"><strong>Are there side effects to the vaccine?</strong><br>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. For additional information, visit <a href="https://www.cdc.gov/coronavirus/2019-ncov/vaccines/safety.html">CDC</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-safety" style="font-size:18px"><strong>Is the vaccine safe?</strong><br>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. For additional information, visit <a href="https://www.cdc.gov/coronavirus/2019-ncov/vaccines/safety.html">CDC</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-effectiveness" style="font-size:18px"><strong>Is the vaccine effective?</strong><br>Pfizer/BioNTechs two-dose vaccine is about 95 percent effective against COVID-19, regardless of age, race or other risks for severe illness from an infection, an FDA analysis shows. Modernas phase 3 clinical trial found its vaccine to be 94.1 percent effective against COVID-19 and 100 percent effective against severe COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p style="font-size:18px"><strong><strong>How can I start to make a vaccine plan for myself and my family?</strong></strong><br>Being informed is the first step to making a plan. Get your information from reliable public health sources such as the Center for Disease Control and Prevention (CDC) and your local public health agency. When its your turn to get the vaccine, ask your primary care provider whether they plan to give the vaccine in their office or what they recommend for you based on your personal medical history. You can find vaccines near you with this interactive map here.</p>\n<!-- /wp:paragraph -->','FAQs','','inherit','closed','closed','','37-revision-v1','','','2021-01-05 15:43:59','2021-01-05 23:43:59','',37,'https://vaccinestemplate.wpcomstaging.com/2021/01/05/37-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (405,93172865,'2021-01-05 15:45:24','2021-01-05 23:45:24','<!-- wp:spacer {"height":20} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"24px"}}} -->\n<p style="font-size:24px"><strong><span style="color:#0071a1;" class="has-inline-color">Percent of County Vaccinated</span></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"16px"}}} -->\n<p style="font-size:16px">County has begun distributing vaccines. You can see how<br>many doses have been served below. [EXAMPLE BELOW]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n\n    <script type="text/javascript" src="https://www.gstatic.com/charts/loader.js"></script>\n    <script type="text/javascript">\n      google.charts.load(\'current\', {\'packages\':[\'corechart\']});\n      google.charts.setOnLoadCallback(drawChart);\n\n      function drawChart() {\n        var data = google.visualization.arrayToDataTable([\n          [\'Date\', \'% of County\'],\n          [\'Dec 1\',  1],\n          [\'Dec 8\',  2.3],\n          [\'Dec 15\',  4.8],\n          [\'Dec 22\',  7.8],\n          [\'Dec 29\',  10.2],\n          [\'Jan 4\',  15.5],\n        ]);\n\n        var options = {\n          curveType: \'function\',\n          legend: { position: \'bottom\' }\n        };\n\n        var chart = new google.visualization.LineChart(document.getElementById(\'curve_chart\'));\n\n        chart.draw(data, options);\n      }\n    </script>\n  \n  \n    <div id="curve_chart" style="width: 900px; height: 500px"></div>\n  \n<!-- /wp:html -->','Our Impact','','inherit','closed','closed','','39-revision-v1','','','2021-01-05 15:45:24','2021-01-05 23:45:24','',39,'https://vaccinestemplate.wpcomstaging.com/2021/01/05/39-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (406,93172865,'2021-01-05 15:45:58','2021-01-05 23:45:58','<!-- wp:paragraph {"align":"left","style":{"typography":{"fontSize":"16px"}}} -->\n<p class="has-text-align-left" style="font-size:16px">The County Department of Public Health works to improve the health an well-being of all residents. We created this site to make it easy for our residents to learn more about COVID-19 vaccinations.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":32,"className":"desktop-only"} -->\n<div style="height:32px" aria-hidden="true" class="wp-block-spacer desktop-only"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {"align":"wide","className":"has-2-columns"} -->\n<div class="wp-block-columns alignwide has-2-columns"><!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"textAlign":"left","level":4} -->\n<h4 class="has-text-align-left">Info</h4>\n<!-- /wp:heading -->\n\n<!-- wp:jetpack/contact-info -->\n<div class="wp-block-jetpack-contact-info"><!-- wp:jetpack/address {"address":"10 Street Road","city":"City","postal":"10100","country":"USA"} -->\n<div class="wp-block-jetpack-address"><div class="jetpack-address__address jetpack-address__address1">10 Street Road</div><div><span class="jetpack-address__city">City</span>, <span class="jetpack-address__region"></span> <span class="jetpack-address__postal">10100</span></div><div class="jetpack-address__country">USA</div></div>\n<!-- /wp:jetpack/address -->\n\n<!-- wp:jetpack/email {"email":"mail@example.com"} -->\n<div class="wp-block-jetpack-email"><a href="mailto:mail@example.com">mail@example.com</a></div>\n<!-- /wp:jetpack/email -->\n\n<!-- wp:jetpack/phone {"phone":"(555) 555 1234"} -->\n<div class="wp-block-jetpack-phone"><a href="tel:5555551234">(555) 555 1234</a></div>\n<!-- /wp:jetpack/phone --></div>\n<!-- /wp:jetpack/contact-info --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:heading {"textAlign":"left","level":4} -->\n<h4 class="has-text-align-left">Send Us a Message</h4>\n<!-- /wp:heading -->\n\n<!-- wp:jetpack/contact-form {"subject":"[County Covid-19 Vaccines] About Us","to":"rchandra100@gmail.com"} -->\n<!-- wp:jetpack/field-name {"required":true} /-->\n\n<!-- wp:jetpack/field-email {"label":"Email","required":true} /-->\n\n<!-- wp:jetpack/field-url /-->\n\n<!-- wp:jetpack/field-textarea {"required":true} /-->\n<!-- /wp:jetpack/contact-form --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->','Contact Us','','inherit','closed','closed','','13-revision-v1','','','2021-01-05 15:45:58','2021-01-05 23:45:58','',13,'https://vaccinestemplate.wpcomstaging.com/2021/01/05/13-revision-v1/',0,'revision','',0);
