INSERT INTO `wp_posts` VALUES (409,93172865,'2021-01-05 15:52:38','2021-01-05 23:52:38','<!-- wp:paragraph {"style":{"typography":{"fontSize":"16px"}}} -->\n<p style="font-size:16px">The vaccine is now available, but will be given in priority order based on a number of factors. If you are a healthy American, you may wait longer than your fellow frontline workers or those who have underlying health conditions. Here is a tentative timeline of distributions in County:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:jetpack/contact-form {"subject":"[County Covid-19 Vaccines] Timeline","to":"rchandra100@gmail.com"} -->\n<!-- wp:jetpack/field-text {"label":"How old are you?","required":true} /-->\n\n<!-- wp:jetpack/field-text {"label":"Which ZIP code do you live in?","required":true} /-->\n\n<!-- wp:jetpack/field-text {"label":"Are you a health care worker or first responder? \\u003cem\\u003e\\u003cstrong\\u003eYES or NO\\u003c/strong\\u003e\\u003c/em\\u003e","required":true} /-->\n\n<!-- wp:jetpack/field-text {"label":"Are you an essential worker (e.g., food, energy, etc.) or teacher? \\u003cem\\u003e\\u003cstrong\\u003eYES or NO\\u003c/strong\\u003e\\u003c/em\\u003e","required":true} /-->\n\n<!-- wp:jetpack/field-text {"label":"Do you have underlying COVID-related heath risks (e.g., heart disease, cancer, diabetes, obesity, etc.)? \\u003cem\\u003e\\u003cstrong\\u003eYES or NO\\u003c/strong\\u003e\\u003c/em\\u003e","required":true} /-->\n\n<!-- wp:jetpack/button {"element":"button","text":"SUBMIT"} /-->\n\n<!-- wp:paragraph -->\n<p>[Note: this questionnaire is currently a placeholder. After we are done building our system, clicking Submit will display your place in line and estimated timeline.]</p>\n<!-- /wp:paragraph -->\n<!-- /wp:jetpack/contact-form -->','Timeline','','inherit','closed','closed','','35-revision-v1','','','2021-01-05 15:52:38','2021-01-05 23:52:38','',35,'https://vaccinestemplate.wpcomstaging.com/2021/01/05/35-revision-v1/',0,'revision','',0);
