INSERT INTO `wp_posts` VALUES (415,93172865,'2021-01-05 16:07:55','2021-01-06 00:07:55','<!-- wp:coblocks/hero {"layout":"center-center","paddingSize":"medium","paddingSyncUnits":true,"customBackgroundColor":"#004fad","height":150,"contentAlign":"center","maxWidth":1000,"coblocks":{"id":"1115193224800"}} -->\n<div class="wp-block-coblocks-hero alignfull coblocks-hero-1115193224800"><div class="wp-block-coblocks-hero__inner has-background hero-center-center-align has-padding has-medium-padding has-center-content" style="background-color:#004fad;min-height:150px"><div class="wp-block-coblocks-hero__content-wrapper"><div class="wp-block-coblocks-hero__content" style="max-width:1000px"><!-- wp:heading {"textAlign":"left","placeholder":"Add hero heading","textColor":"white","style":{"typography":{"lineHeight":"1.5","fontSize":"32px"}}} -->\n<h2 class="has-text-align-left has-white-color has-text-color" style="font-size:32px;line-height:1.5"><strong>Vaccines are here</strong>.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {"align":"right","id":242,"width":175,"height":175,"sizeSlug":"large","linkDestination":"none"} -->\n<div class="wp-block-image"><figure class="alignright size-large is-resized"><img src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/vaccine-clip-art.png?w=500" alt="" class="wp-image-242" width="175" height="175"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {"align":"left","placeholder":"Add hero content, which is typically an introductory area of a page accompanied by call to action or two.","textColor":"white","style":{"typography":{"lineHeight":"1.5","fontSize":"16px"}}} -->\n<p class="has-text-align-left has-white-color has-text-color" style="font-size:16px;line-height:1.5">The FDA has granted emergency use authorization to the Pfizer-BioNTech COVID-19 Vaccine. Doses arrived in County on December 14, and will be distributed to healthcare workers and those with high vulnerabilities first.<br><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons {"contentJustification":"left","align":"center"} -->\n<div class="wp-block-buttons is-content-justification-left"><!-- wp:button {"placeholder":"Primary button","borderRadius":5,"style":{"color":{"background":"#ec5d4f"}},"textColor":"white","width":50} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50"><a class="wp-block-button__link has-white-color has-text-color has-background" href="https://vaccinestemplate.wpcomstaging.com/timeline/" style="border-radius:5px;background-color:#ec5d4f">When can I get the vaccine?</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div></div></div></div>\n<!-- /wp:coblocks/hero -->\n\n<!-- wp:spacer {"height":20} -->\n<div style="height:20px" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {"align":"center","style":{"typography":{"fontSize":"18px"}}} -->\n<p class="has-text-align-center" style="font-size:18px"><strong><span style="color:#004fad;" class="has-inline-color">We know you have questions.</span> <span style="color:#004fad;" class="has-inline-color">We\'re here to help.</span></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {"color":"black","className":"is-style-default"} -->\n<hr class="wp-block-separator has-text-color has-background has-black-background-color has-black-color is-style-default"/>\n<!-- /wp:separator -->\n\n<!-- wp:buttons -->\n<div class="wp-block-buttons"><!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/faqs#vaccine-work"><img class="wp-image-371" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/science.png" alt=""><br><br>How does the vaccine work?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/schedule-your-vaccination/"><img class="wp-image-369" style="width: 58px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/map-01.png" alt=""><br><br>Where can I get the vaccine?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/timeline/"><img class="wp-image-277" style="width: 64px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/calendar-1.png" alt=""><br><br>When can I get the vaccine?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/doses-given/"><img class="wp-image-286" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/vaccine-1.png" alt=""><br><br>How many people have received the vaccine?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/faqs#vaccine-safety"><img class="wp-image-284" style="width:60px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/magnifying-glass-1.png" alt=""><br><br>Is the vaccine safe?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {"borderRadius":0,"textColor":"black","width":50,"className":"is-style-outline"} -->\n<div class="wp-block-button has-custom-width wp-block-button__width-50 is-style-outline"><a class="wp-block-button__link has-black-color has-text-color no-border-radius" href="https://vaccinestemplate.wpcomstaging.com/faqs#vaccine-effectiveness"><img class="wp-image-285" style="width:57px;" src="https://vaccinestemplate.wpcomstaging.com/wp-content/uploads/2020/12/lungs-1.png" alt=""><br><br>Is the vaccine effective?</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->','','','inherit','closed','closed','','2-revision-v1','','','2021-01-05 16:07:55','2021-01-06 00:07:55','',2,'https://vaccinestemplate.wpcomstaging.com/2021/01/05/2-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (416,93172865,'2021-01-05 16:11:30','2021-01-06 00:11:30','<!-- wp:paragraph -->\n<p>[Example Content Below]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Last updated January 5, 2021.<br>Available languages [Placeholders]: <a href="https://vaccinestemplate.wpcomstaging.com/faqs/">Espaol</a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/">Ting Vit</a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/"></a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/">Soomaali</a> | <a href="https://vaccinestemplate.wpcomstaging.com/faqs/"></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p style="font-size:18px"><strong>Am I and my family eligible for the vaccine? </strong><br>The CDC recommends that initial supplies of COVID-19 vaccine be allocated to healthcare personnel and long-term care facility residents. This is referred to as Phase 1a. In the in the next phases (Phase 1b and Phase 1c), vaccination should be offered to people in the following groups.<br><br><em>Phase 1b</em><br>- Frontline essential workers such as fire fighters, police officers, corrections officers, food and agricultural workers, United States Postal Service workers, manufacturing workers, grocery store workers, public transit workers, and those who work in the educational sector (teachers, support staff, and daycare workers.)<br>- People aged 75 years and older because they are at high risk of hospitalization, illness, and death from COVID-19. People aged 75 years and older who are also residents of long-term care facilities should be offered vaccination in Phase 1a.<br><br><em>Phase 1c</em><br>- People aged 6574 years because they are at high risk of hospitalization, illness, and death from COVID-19. People aged 6574 years who are also residents of long-term care facilities should be offered vaccination in Phase 1a.<br> - People aged 1664 years with underlying medical conditions which increase the risk of serious, life-threatening complications from COVID-19.<br>- Other essential workers, such as people who work in transportation and logistics, food service, housing construction and finance, information technology, communications, energy, law, media, public safety, and public health.<br><br>As vaccine availability increases, vaccination recommendations will expand to include more groups. The goal is for everyone to be able to easily get a COVID-19 vaccination as soon as large enough quantities of vaccine are available. As vaccine supply increases but remains limited, ACIP will expand the groups recommended for vaccination. CDC made this recommendation on December 22, 2020.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-work" style="font-size:18px"><strong>How does the vaccine work?</strong><br>COVID-19 vaccines help our bodies develop immunity to the virus that causes COVID-19 without us having to get the illness. Different types of vaccines work in different ways to offer protection, but with all types of vaccines, the body is left with a supply of memory T-lymphocytes as well as B-lymphocytes that will remember how to fight that virus in the future. The vaccine requires two shots: the first shot starts building protection, and a second shot is needed a few weeks later to get the most protection the vaccine has to offer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-side-effects" style="font-size:18px"><strong>Are there side effects to the vaccine?</strong><br>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. For additional information, visit <a href="https://www.cdc.gov/coronavirus/2019-ncov/vaccines/safety.html">CDC</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-safety" style="font-size:18px"><strong>Is the vaccine safe?</strong><br>Vaccine safety is a priority. All COVID-19 vaccines must go through a rigorous and multi-step testing, evaluation and approval process before they can be used. They will only be approved if they pass FDAs safety and effectiveness standards. Vaccines will also be monitored for safety once they are given. For additional information, visit <a href="https://www.cdc.gov/coronavirus/2019-ncov/vaccines/safety.html">CDC</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p id="vaccine-effectiveness" style="font-size:18px"><strong>Is the vaccine effective?</strong><br>Pfizer/BioNTechs two-dose vaccine is about 95 percent effective against COVID-19, regardless of age, race or other risks for severe illness from an infection, an FDA analysis shows. Modernas phase 3 clinical trial found its vaccine to be 94.1 percent effective against COVID-19 and 100 percent effective against severe COVID-19.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":"18px"}}} -->\n<p style="font-size:18px"><strong><strong>How can I start to make a vaccine plan for myself and my family?</strong></strong><br>Being informed is the first step to making a plan. Get your information from reliable public health sources such as the Center for Disease Control and Prevention (CDC) and your local public health agency. When its your turn to get the vaccine, ask your primary care provider whether they plan to give the vaccine in their office or what they recommend for you based on your personal medical history. You can find vaccines near you with this interactive map here.</p>\n<!-- /wp:paragraph -->','FAQs','','inherit','closed','closed','','37-revision-v1','','','2021-01-05 16:11:30','2021-01-06 00:11:30','',37,'https://vaccinestemplate.wpcomstaging.com/2021/01/05/37-revision-v1/',0,'revision','',0);
